    [],nt"num_tags": 4,nt"name": "clarence-cannon-national-wildlife-refuge-annual-narrative-report-calendar-year-1984",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Clarence
    Cannon NWR outlines Refuge accomplishments during the 1984 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. The report
    includes a planning section which discusses management planning. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, and safety is given. Habitat management is also covered; subjects
    include wetlands, croplands, fire management, and pest control. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, animal control, and
    disease control. The public uses of the Refuge described in this report include
    interpretive programs. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, equipment replacement, and energy
    conservation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
